import { Component } from "react";
import { Link } from "react-router-dom";
import { UgNaveList } from "./UgNaveList";
import './Navbar.css';
import { About } from "./About";
import Logo from './images/logo2.jpeg'
import { UgHomePage } from "../egard MAIN page/UG PAGES/UgHomePage";
import { Banner } from "./Banners";
import { ExploreExams } from "./Explore  exams/ExploreExams";
import { OurCourses } from "./OUR COURSES/OurCourses";


class UGHOMEPAGE extends Component{
    state = {clicked: false}
    hadleClick = () => {
        this.setState({clicked: !this.state.clicked})
    }
    render(){
        return(
            <div>
                <nav className="navbarItems">
                    <img src={Logo} width={200} alt=""/>
                    {/* mobail-icons */}
                    <div className='menu-icons' onClick={this.hadleClick}>
                        <i className={this.state.clicked ? 'fas fa-times' : 'fas fa-bars'}></i>

                    </div>

                    {/* nav-list and icons */}
                    <ul className={this.state.clicked ? 'nav-menu active' : 'nav-menu'}>
                        {UgNaveList.map((item,index) =>{
                            return(
                                <li key={index}>
                                    <Link className={item.cNmae} to={item.url}> 
                                    <i className={item.icon}></i>{item.title }</Link>
                                </li>
                            )
                        })}

                    </ul>
                </nav>
               <div style={{marginTop: '5rem'}}>
               <div style={{marginBottom: '1rem'}}>
                <marquee >
                <img src="images.html/orange-and-blue-update-uuoxy0bmznjnamgg.gif" alt="" class="new" />All tests will be LIVE according to the detailed schedule given. Do not confuse to the Total No. of tests in the test cards while buying as they show the number of tests LIVE at the moment..</marquee>
                </div>
                <UgHomePage/>
                </div>
                {/* <Banner /> */}

                <div  className="">
                <About />
                </div>

                <div>
                    <ExploreExams />
                </div>

                <div>
                    <OurCourses />
                </div>
            </div>
        )
    }
}
export default UGHOMEPAGE;
